import React from "react";
import "./CoinSpin.scss";

export default function CoinSpin() {
  return (
    <div>
      <div class="coinspin__one">
        <div class="front"></div>
        <div class="front_b"></div>
        <div class="back"></div>
        <div class="back_b"></div>
      </div>

      <div class="coinspin__two">
        <div class="front"></div>
        <div class="front_b"></div>
        <div class="back"></div>
        <div class="back_b"></div>
      </div>
    </div>
  );
}
